function NewDeckView({formData}){
    const {url} = useRouteMatch();

    return (
        <>
          <h2>Deck</h2>
          <ul>
            New Deck View
            {formData.map((currentValue, index) => (
                <li key={index}>
                    <Link to="`${url}/`${id}`">
                    {currentValue.name}
                    </Link></li>
            ))}
          </ul>
        </>
      );


}

export default NewDeckView;
